webpackJsonp([291],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-linking-your-account-with-github.json":function(o,e){o.exports={data:{markdownRemark:{html:'<p>In August 2015, we pushed some changes that caused trouble for many of our campers.</p>\n<p>If you are unable to link your GitHub account to your current account, here is what we recommend doing:</p>\n<ol>\n<li>Sign out with your current account and try signing in with GitHub.  </li>\n<li>Check your challenge map. Your account should have no progress. Delete that account here: <a href="http://freecodecamp.com/account">http://freecodecamp.com/account</a>  </li>\n<li>Sign into Free Code Camp the way you normally do (Facebook, email, etc). You should see your original progress.  </li>\n<li>Now add GitHub to that account, and you should be all set.</li>\n</ol>',frontmatter:{title:"Linking Your Account with Github",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/linking-your-account-with-github/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/linking-your-account-with-github/"}}}});
